import React, { useState } from 'react';
import { TextField, Button, Typography, Card, CardContent, Box, CircularProgress } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Login({ 
    setIsAuthenticated, 
    handleSnackbarOpen,
    setApiKey: setParentApiKey,
    setUserId: setParentUserId,
    setBusinessId: setParentBusinessId,
    setBusinessApiKey: setParentBusinessApiKey
}) {
    const [isLoading, setIsLoading] = useState(false);
    const [apiKey, setApiKey] = useState('');
    const [userId, setUserId] = useState('');
    const [businessId, setBusinessId] = useState('');
    const [businessApiKey, setBusinessApiKey] = useState('');
    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        setIsLoading(true);

        try {
            const response = await fetch('/validate_config', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${apiKey}`
                },
                credentials: 'include',
                body: JSON.stringify({
                    userId,
                    businessId,
                    businessApiKey
                })
            });

            if (!response.ok) {
                const errorData = await response.json();
                throw new Error(errorData.message || 'Login failed');
            }

            const data = await response.json();
            if (data.isValid) {
                // Store credentials in localStorage
                localStorage.setItem('apiKey', apiKey);
                localStorage.setItem('userId', userId);
                localStorage.setItem('businessId', businessId);
                localStorage.setItem('businessApiKey', businessApiKey);

                // Update parent state
                setParentApiKey(apiKey);
                setParentUserId(userId);
                setParentBusinessId(businessId);
                setParentBusinessApiKey(businessApiKey);

                // Save configuration
                const saveResponse = await fetch('/api/save-config', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${apiKey}`
                    },
                    credentials: 'include',
                    body: JSON.stringify({
                        userId,
                        businessId,
                        businessApiKey
                    })
                });

                if (!saveResponse.ok) {
                    const errorData = await saveResponse.json();
                    throw new Error(errorData.message || 'Failed to save configuration');
                }

                handleSnackbarOpen('Login successful', 'success');
                setIsAuthenticated(true);
                navigate('/');
            } else {
                throw new Error(data.error || 'Login failed');
            }
        } catch (error) {
            console.error('Login error:', error);
            handleSnackbarOpen(error.message || 'Login failed', 'error');
            setIsAuthenticated(false);
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <Card sx={{ mt: 4, maxWidth: 400, mx: 'auto' }}>
            <CardContent>
                <Typography variant="h5" gutterBottom align="center">
                    Login
                </Typography>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
                    <TextField
                        label="ICMP API Key"
                        variant="outlined"
                        value={apiKey}
                        onChange={(e) => setApiKey(e.target.value)}
                        disabled={isLoading}
                        type="password"
                        required
                        error={!apiKey}
                        helperText={!apiKey ? "ICMP API Key is required" : ""}
                        fullWidth
                    />
                    <TextField
                        label="Business API Key"
                        variant="outlined"
                        value={businessApiKey}
                        onChange={(e) => setBusinessApiKey(e.target.value)}
                        disabled={isLoading}
                        type="password"
                        required
                        error={!businessApiKey}
                        helperText={!businessApiKey ? "Business API Key is required" : ""}
                        fullWidth
                    />
                    <TextField 
                        label="User ID" 
                        variant="outlined" 
                        value={userId}
                        onChange={(e) => setUserId(e.target.value)}
                        disabled={isLoading}
                        required
                        error={!userId}
                        helperText={!userId ? "User ID is required" : ""}
                        fullWidth
                    />
                    <TextField 
                        label="Business ID" 
                        variant="outlined" 
                        value={businessId}
                        onChange={(e) => setBusinessId(e.target.value)}
                        disabled={isLoading}
                        required
                        error={!businessId}
                        helperText={!businessId ? "Business ID is required" : ""}
                        fullWidth
                    />

                    <Button 
                        variant="contained" 
                        onClick={handleSubmit} 
                        disabled={isLoading || !apiKey || !userId || !businessId || !businessApiKey}
                        fullWidth
                    >
                        {isLoading ? <CircularProgress size={24} /> : 'Login'}
                    </Button>
                </Box>
            </CardContent>
        </Card>
    );
}

export default Login;
